import { useParams } from "react-router-dom";
import { useState } from "react";
import useFetch from "../hooks/useFetch";



const List = () => {
    const { namee }= useParams();
    const { data,loading,error } = useFetch(`http://localhost:8800/api/hotels//finda/:area=${namee}`);
    console.log(data.area);
    if (loading) {
        return <div>Loading...</div>;
      }
    
      if (error) {
        return <div>Error fetching data</div>;
      }
    
      return (
        <div>
          <h1>Hotels in {name}</h1>
          {data.map((hotel) => (
            <div key={hotel._id}>
              <h2>{hotel.name}</h2>
              <p>Location: {hotel.location}</p>
              <p>Distance: {hotel.distance}</p>
              <img src={hotel.photos} alt={hotel.name} />
              <p>Rating: {hotel.rating}</p>
              <p>Cheapest Price: {hotel.cheapestPrice}</p>
            </div>
          ))}
        </div>
      );
    }
export default List;
